import styled from 'styled-components'

export const MidFooterWrapper = styled.div`
    width: 100%;
    height: 200px;
    background: #BFCFFF;
    margin-top: 20px;
`

export const MidFooterItemWrapper = styled.div``

export const MidFooterImage = styled.div`
    width: 50px;
    border-radius: 25px 
    border: 1px solid black 
